function App() {

  socket.on("user", msg=>{
    console.log(msg)
  })

  return (
    <div className="container">
      <div className="left">
        <ChatArea/>
      </div>  
      <div className="right">
        <InfoArea/>
        <UtilsArea/>
      </div>
    </div>
  );
}

export default App;
